import React from "react";
import '../style.css';
class Home extends React.Component {
  render() {
    return (
      <div>
        <h2><font color ="white" size = "50">Home</font></h2>
        <button onClick={() => {
          console.log(window.localStorage.getItem("username"));
        }}>Click me</button>
      </div>
    );
  }
}

export default Home
